import * as React from 'react';
import { Form, Formik } from 'formik';

export default function SearchBar() {
    return (
        <Formik
            initialValues={{}}
            onSubmit={() => { }}
        >
            <Form>
                <input type="text" name="search" />
                <button type="submit">Search</button>
            </Form>
        </Formik>
    );
}
